import React, { Fragment, useState } from "react";
import axios from 'axios'

const Feedback = ({ sendFeedback }) => {

    const [formData, setFormData] = useState({
        sender: '',
        feedback: ''
    })

    const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value })
    const { sender, feedback } = formData
    const onSubmit = (e) => {
        e.preventDefault();
        try {
            sendFeedback(feedback, sender)
        }
        catch (err) {

        }
    }

    return (
        <Fragment>
            <button className="btn btn-light" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasRight" aria-controls="offcanvasRight">Feedback</button>

            <div className="offcanvas offcanvas-end" tabindex="-1" id="offcanvasRight" aria-labelledby="offcanvasRightLabel">
                <div className="offcanvas-header">
                    <h5 id="offcanvasRightLabel">Feedback</h5>
                    <button type="button" className="btn-close text-reset" data-bs-dismiss="offcanvas" aria-label="Close"></button>
                </div>
                <div className="offcanvas-body">
                    <label htmlFor="sender">Name : </label>
                    <input type="text" classNameName="form-control mt-3" onChange={e => { onChange(e) }} name="sender" />
                    <label htmlFor="feedback">Message : </label>
                    <input type="text" classNameName="form-control mt-3" onChange={e => { onChange(e) }} name="feedback" />
                    <button type="submit" classNameName="btn btn-primary mt-4">Submit</button>
                </div>
            </div>


        </Fragment>
    );
}

export default Feedback;
